import React, { useState } from 'react';
import { useEffect } from 'react';


export default function PageAccueil() {
  const [first, setFirst] = useState(0);
  let myInterval;
  useEffect(() => {
     myInterval = setInterval(() => {
      setFirst(first+1);
  }, 1000);
  });
  
  return (
    <div>
        <p>
          {first}
        </p>
    </div>
  )
}
